PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "migrations" ("id" integer primary key autoincrement not null, "migration" varchar not null, "batch" integer not null);
CREATE TABLE IF NOT EXISTS "users" ("id" integer primary key autoincrement not null, "name" varchar not null, "email" varchar not null, "email_verified_at" datetime, "password" varchar not null, "remember_token" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("email" varchar not null, "token" varchar not null, "created_at" datetime, primary key ("email"));
CREATE TABLE IF NOT EXISTS "failed_jobs" ("id" integer primary key autoincrement not null, "uuid" varchar not null, "connection" text not null, "queue" text not null, "payload" text not null, "exception" text not null, "failed_at" datetime not null default CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "personal_access_tokens" ("id" integer primary key autoincrement not null, "tokenable_type" varchar not null, "tokenable_id" integer not null, "name" varchar not null, "token" varchar not null, "abilities" text, "last_used_at" datetime, "expires_at" datetime, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "advertisements" ("id" integer primary key autoincrement not null, "type" varchar not null, "brand" varchar not null, "description" text not null, "price" varchar not null, "kilometer" varchar not null, "license_plate" varchar not null, "build_year" integer not null, "fuel" varchar not null, "transmission" varchar not null, "color" varchar not null, "power" varchar not null, "btw" tinyint(1) not null, "doors" integer not null, "seating" integer not null, "apk_expire_date" datetime not null, "fuel_usage" varchar not null, "cylinder_capacity" varchar not null, "weight" integer not null, "extras" text default '', "created_at" datetime, "updated_at" datetime, "deleted_at" datetime);
CREATE TABLE IF NOT EXISTS "contacts" ("id" integer primary key autoincrement not null, "name" varchar not null, "body" varchar not null, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "web_contents" ("id" integer primary key autoincrement not null, "key" varchar not null, "head" varchar, "body" text, "created_at" datetime, "updated_at" datetime);
CREATE TABLE IF NOT EXISTS "files" ("id" integer primary key autoincrement not null, "thumbnail" tinyint(1) not null default '0', "location" text not null, "advertisement_id" integer not null, "created_at" datetime, "updated_at" datetime);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "users_email_unique" on "users" ("email");
CREATE UNIQUE INDEX "failed_jobs_uuid_unique" on "failed_jobs" ("uuid");
CREATE INDEX "personal_access_tokens_tokenable_type_tokenable_id_index" on "personal_access_tokens" ("tokenable_type", "tokenable_id");
CREATE UNIQUE INDEX "personal_access_tokens_token_unique" on "personal_access_tokens" ("token");
CREATE UNIQUE INDEX "web_contents_key_unique" on "web_contents" ("key");
COMMIT;
